syms x1 x2 x3 u v real
x = [x1;x2;x3];

S = [1 1 0 ; 0 -1 -1 ; 2 2 -1];
iS = inv(S) %[output:76ae5214]
A = S * diag([-1,-2,-3]) / S %[output:34a27ee4]
f = A*x + [x3*x2 ; -x1*x3 ; x1^2*x2] %[output:65afce8a]
g = [0;0;1];
h = x1;
%%
%[text] ## The output function: $\\Phi\_1(x) = h(x)$
Phi1 = h %[output:3f07f5c1]
Lie(1,g,Phi1,x) %[output:21ea26fd]
%[text] The first derivative: $\\Phi\_2(x) = L\_f h(x) + L\_g h(x) \\, u$, where $L\_g h(x) = 0$
Phi2 = Lie(1,f,Phi1,x) + Lie(1,g,Phi1,x)*u %[output:21c08d1c]
Lie(1,g,Phi2,x) %[output:5398582d]
%[text] The second derivative: $\\Phi\_3(x) = L\_f^2 h(x) + L\_g L\_f h(x) \\, u$, where $L\_g L\_f h(x) \\neq 0$
Phi3 = Lie(1,f,Phi2,x) + Lie(1,g,Phi2,x)*u %[output:79b85040]
%[text] 
%[text] The feedback linearizing input: $u = \\frac{v - L\_f^2 h(x)}{L\_g L\_f h(x)}$
u_FdbLin = Lie(1,g,Phi2,x) \ (v - Lie(1,f,Phi2,x)) %[output:998750c7]
%[text] As the relative degree is 2, the third output transformation $\\Phi\_3(x)$ is not used in the final coordinates transformation, but $\\Phi(x) = \\pmatrix{ \\Phi\_\\xi(x) \\cr \\Phi\_\\eta(x) }$, where $\\Phi\_\\xi(x) = \\pmatrix{ \\Phi\_1(x) \\cr \\Phi\_2(x) }$
Phi_xi = [Phi1 ; Phi2] %[output:97041532]
T_x = jacobian(Phi_xi,x) %[output:74e024c4]
simplify(T_x * x - Phi_xi) %[output:49777749]
%%
%[text] Then, we select $\\Phi\_\\eta(x) $ and check whether $L\_g \\Phi\_\\eta(x) = 0$.
Phi_eta = x2;
Lg_Phi_eta = Lie(1,g,Phi_eta,x) %[output:4935dbd6]
Phi = [ %[output:group:4171a549] %[output:2ca47b1b]
    Phi_xi %[output:2ca47b1b]
    Phi_eta %[output:2ca47b1b]
    ] %[output:group:4171a549] %[output:2ca47b1b]
J_Phi = jacobian(Phi,x) %[output:99b96db3]
det(J_Phi) %[output:6e8737bf]
figure(11), hold on, grid on, box on; %[output:44ef3aa7]
[xx2,xx3] = meshgrid(linspace(-5,5,101));
Phi2_fh = matlabFunction(Phi2) %[output:708577bf]
contour(xx2,xx3,Phi2_fh(xx2*0,xx2,xx3),[0 0]) %[output:44ef3aa7]
%%
%[text] ## Zero dynamics
syms xi1 xi2 eta real
xi = [xi1;xi2];
z = [xi;eta] %[output:522f3962]
sol = solve(z == Phi,x,"Real",true,"ReturnConditions",false) %[output:6e6d2420]
iPhi = [sol.x1 ; sol.x2 ; sol.x3] %[output:077d9160]
q = subs(subs(Lie(1,f,Phi_eta,x),x,iPhi),xi,xi*0) %[output:046efdaf]
fig = figure(12), hold on, grid on %[output:1a1fed54] %[output:0c7efaaf]
ezplot(q,[-10,10]) %[output:0c7efaaf]
%[text] The zero dynamics is BISTABLE.
%%
f_cls = f + g*subs(u_FdbLin,v,-10*h) %[output:2be5a063]
f_ode = matlabFunction(f_cls,'Vars',{sym('t'),x}) %[output:991592f2]
sol = solve([Phi_xi;x2 == 1.01],x) %[output:796405cf]
x0 = double([sol.x1,sol.x2,sol.x3]') %[output:8e7c21c9]
[tt,xx] = ode45(f_ode,[0,10],x0) %[output:6466ee8c] %[output:23093979]
figure(13), hold on, grid on,  %[output:0c83e69b]
plot3(xx(:,1), xx(:,2), xx(:,3)) %[output:0c83e69b]
plot3(xx(1,1), xx(1,2), xx(1,3),'.') %[output:0c83e69b]
xlabel x1 %[output:0c83e69b]
ylabel x2 %[output:0c83e69b]
zlabel x3 %[output:0c83e69b]
view([90 0]) %[output:0c83e69b]
%%
function ret = Lie(r,f,h,x)
    if r == 1
        ret = jacobian(h,x)*f;
    else
        ret = Lie(1,f,Lie(r-1,f,h,x),x);
    end
end

